Desde el seminario de trabajo: <strong>"La radio escolar como herramienta pedagógica"</strong> el profesorado ha trabajado en la grabación y edición de diferentes audios para elaborar este pequeño producto radiofónico. En esta cuarta sesión del seminario conocimos la herramienta <a href="https://www.audacityteam.org/"><em>Audacity</em></a>, trabajando en pareja la grabación y edición de podcast con un único hilo conductor: No a la guerra.

